async function fcn_benchmarkAjax(e=1,n={},t=null,o={},r="get"){let c=0;console.log(`Starting benchmark with ${e} AJAX requests...`);for(let s=0;s<e;s++){const e=performance.now();try{"get"===r?await fcn_ajaxGet(n,t,o):await FcnUtils.aPost(n,t,o),c+=performance.now()-e}catch(e){console.error("Error during AJAX request:",e)}}const s=c/e;return console.log(`Finished benchmarking. Average AJAX response time over ${e} requests: ${s.toFixed(2)} ms`),s}function fcn_printAjaxResponse(e,n="get"){"get"===n?fcn_ajaxGet(e).then((e=>{console.log(e)})):FcnUtils.aPost(e).then((e=>{console.log(e)}))}